#' @param SearchVariantSetsRequest The \link{SearchVariantSetsRequest} object to pass to this method
#' #' @importFrom googleAuthR gar_api_generator
#' @family SearchVariantSetsRequest functions
#' @export
variantsets.search <- function(SearchVariantSetsRequest) {
    url <- "https://www.googleapis.com/genomics/v1beta2/variantsets/search"
    # genomics.variantsets.search
    f <- gar_api_generator(url, "POST", data_parse_function = function(x) x)
    stopifnot(inherits(SearchVariantSetsRequest, "gar_SearchVariantSetsRequest"))
    
    f(the_body = SearchVariantSetsRequest)
    
}


