#' @importFrom googleAuthR gar_api_generator
#' @family VariantSet functions
#' @export


variantsets.update <- function(VariantSet, variantSetId) {
    
    
    url <- sprintf("https://www.googleapis.com/genomics/v1beta2/variantsets/%s", 
        variantSetId)
    # genomics.variantsets.update
    f <- gar_api_generator(url, "PUT", data_parse_function = function(x) x)
    
    stopifnot(inherits(VariantSet, "gar_VariantSet"))
    
    f(the_body = VariantSet)
    
    
}



